function intermediateconditional45() {
	var isOk = false;
	var numProcess = getValue("WKNumProces");
	// var usuario = getValue("WKUser");
	var form = hAPI.getCardData(numProcess);
	var strDados = form.get('jsonDadosForn');
	var objForn = JSON.parse(strDados);
	if( objForn ){
		if(objForn.finalizarExecucao == "1"){
			isOk = true;
		}
	}
	return isOk;
}

